import PropTypes from "prop-types";
import React from "react";

export const Navigation = ({
  property1,
  className,
  text = "Projects",
  text1 = "Contact",
  hasBeforeLogin = true,
}) => {
  return (
    <div className="Navbar" style={{width: 1440, height: 103, paddingLeft: 20, paddingRight: 20, background: '#B9BBFF', boxShadow: '0px 20px 40px rgba(0, 0, 0, 0.15)', justifyContent: 'space-between', alignItems: 'center', display: 'inline-flex'}}>
  <div className="VaskendesignlogoPng" style={{padding: 20, flexDirection: 'column', justifyContent: 'flex-start', alignItems: 'flex-start', gap: 20, display: 'inline-flex'}}>
    <img className="Image1" style={{width: 195, height: 39}} src="https://via.placeholder.com/195x39" />
  </div>
  <div className="CommonMenu" style={{justifyContent: 'center', alignItems: 'center', gap: 7, display: 'flex'}}>
    <div className="Frame5" style={{padding: 20, justifyContent: 'center', alignItems: 'center', gap: 20, display: 'flex'}}>
      <div className="Home" style={{color: '#121212', fontSize: 20, fontFamily: 'Varela Round', fontWeight: '400', lineHeight: 31.03, wordWrap: 'break-word'}}>Home</div>
    </div>
    <div className="Frame3" style={{padding: 20, justifyContent: 'center', alignItems: 'center', gap: 20, display: 'flex'}}>
      <div className="About" style={{color: '#121212', fontSize: 20, fontFamily: 'Varela Round', fontWeight: '400', lineHeight: 31.03, wordWrap: 'break-word'}}>About</div>
    </div>
    <div className="Frame2" style={{padding: 20, justifyContent: 'center', alignItems: 'center', gap: 20, display: 'flex'}}>
      <div className="Projects" style={{color: '#121212', fontSize: 20, fontFamily: 'Varela Round', fontWeight: '400', lineHeight: 31.03, wordWrap: 'break-word'}}>Projects</div>
    </div>
    <div className="Frame4" style={{padding: 20, justifyContent: 'center', alignItems: 'center', gap: 20, display: 'flex'}}>
      <div className="ContactMe" style={{color: '#121212', fontSize: 20, fontFamily: 'Varela Round', fontWeight: '400', lineHeight: 31.03, wordWrap: 'break-word'}}>Contact</div>
    </div>
  </div>
</div>
  );
};

Navigation.propTypes = {
  property1: PropTypes.oneOf(["desktop", "tablet", "mobile"]),
  text: PropTypes.string,
  text1: PropTypes.string,
  hasBeforeLogin: PropTypes.bool,
};
